import React from 'react';
import { primaryOrange, darkGray, lightGray, white } from './colors';

function Footer() {
    return (
        <footer style={{
            padding: '20px',
            textAlign: 'center',
            backgroundColor: lightGray,
            borderTop: '1px solid #ddd'
        }}>
            <button style={{
                backgroundColor: primaryOrange,
                color: white,
                padding: '10px 15px',
                border: 'none',
                borderRadius: '4px',
                cursor: 'pointer',
                margin: '0 10px',
                transition: 'background-color 0.3s ease'
            }}>
                Retour
            </button>
            <button style={{
                backgroundColor: primaryOrange,
                color: white,
                padding: '10px 15px',
                border: 'none',
                borderRadius: '4px',
                cursor: 'pointer',
                margin: '0 10px',
                transition: 'background-color 0.3s ease'
            }}>
                Suite
            </button>
            <button style={{
                backgroundColor: primaryOrange,
                color: white,
                padding: '10px 15px',
                border: 'none',
                borderRadius: '4px',
                cursor: 'pointer',
                margin: '0 10px',
                transition: 'background-color 0.3s ease'
            }}>
                Fin
            </button>
        </footer>
    );
}

export default Footer;
